import { createStore } from 'vuex'
import AuthModule from './auth/index';
import PostModule from './post/index';
import SweetAlert from './utils/index';

const store = createStore({
  modules:{
    auth: AuthModule,
    post: PostModule,
    alert: SweetAlert
  },
})

export default store
